import {productContext} from '../'

import {List} from './style'


export default function Nav() {

    const {produ } = useContext(productContext)

    return (
        <>
         <List>
            <li>All</li>
            <li>Car</li>
            <li>Bike</li>
         </List>
        </>
    )

}
